import React, {Component, Fragment} from "react";
import {MDBContainer} from "mdbreact";
import NavbarPage from "./Components/navbar";
import "./index.css";
import BoxPage from "./Components/textbox";
import GridBlock from "./Components/grid";





class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      items:[],
      isLoaded:false,
      error:null
     
    };

  }


componentDidMount(){

  fetch("https://api.unsplash.com/search/photos?query=movies&limit=10&client_id=cz_uQE-jqdAx0A4ZMyd38aWHz4UUDLQuWIg-S3f3lO0")
  .then(res => res.json())
  .then(
    (result) =>{
      this.setState({
        isLoaded:true, items:result.items
      });
},
(error) => {
  this.setState({
    isLoaded: true,
    error
  });
}
  )
}






  render(){
const {isLoaded, items,error} = this.state;
if(error){
  return <div> Error: 404</div>;
}
else 

if(!isLoaded) {

  return <div>  Loading......</div>
}
else{


    return(
      <Fragment>
      
      <MDBContainer fluid className="header-container">
      <NavbarPage />
      <BoxPage />
      </MDBContainer>
      <GridBlock />
      <MDBContainer fluid>
     
      <ul>
        
   
      </ul>
    
      </MDBContainer>
     
      </Fragment>
        
      
    );
  }
  }
}
export default App;
